paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 400 ? 400 : (v < 20 ? 20 : v));
            return v;
        }
    case 1:
        {
            v = (v > 500 ? 500 : (v < 20 ? 20 : v));
            return v;
        }
    case 2:
        {
            v = (v > 160 ? 160 : (v < 2 ? 2 : v));
            return v;
        }
    case 3:
        {
            v = (v > 500 ? 500 : (v < 5 ? 5 : v));
            return v;
        }
    case 4:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 5:
        {
            v = (v > 4 ? 4 : (v < 1 ? 1 : v));
            return v;
        }
    case 6:
        {
            v = (v > 200 ? 200 : (v < 20 ? 20 : v));
            return v;
        }
    case 7:
        {
            v = (v > 2 ? 2 : (v < 1 ? 1 : v));
            return v;
        }
